		.then(res => res.json())

		.then(json =>
			 setPages(json)
			  )

		.then(json => console.log(json))
		 });


	return (
	<>	


	</>

	);


}


function Page() {
  return (
    <div className="container-fluid">
		<FetchContent />
	 </div>
  );
}

export default Page;
